// SPDX-License-Identifier: MIT

pragma solidity ^0.8.3;

import "./Ownable.sol";

contract SharedWallet is Owned {

    uint public funds;

    constructor() {

    }

    function depositFunds(uint _amount) public {
        funds += _amount;
    }

    function withdrawFunds(uint _amount) public {

    }

    function ownerWithdrawFunds(uint _amount) public onlyOwner {
        assert(funds - _amount < funds);
        funds -= _amount;
        payable(msg.sender).transfer(_amount);
    }

    receive() external payable {
        depositFunds(msg.value);
    }
}

